import React from "react";
import { Button } from "antd";
import Logo from "../../../assets/images/png/3.1 logo-white.png";
import { MenuFoldOutlined, PoweroffOutlined } from "@ant-design/icons";
import "./MenuTop.scss";
export default function () {
  return (
    <div className="menu-top">
      <div className="menu-top-left">
        <img className="menu-top-left-logo" src={Logo} alt="logo" />
        <Button type="link" onClick={() => console.log("Me has Clikeado")}>
          <MenuFoldOutlined />
        </Button>
      </div>
      <div className="menu-top-right">
        <Button type="link" onClick={() => console.log("Desconexion")}>
          <PoweroffOutlined></PoweroffOutlined>
        </Button>
      </div>
    </div>
  );
}
